import React from "react";
import { NavLink } from "react-router-dom";

const Card = () => {
  return (
    <>
              <div className="col-md-4 col-12 mx-auto">
                <div className="card">
                  <img src="https://cdn.pixabay.com/photo/2015/10/09/00/55/lotus-978659__340.jpg" className="card-img-top" alt="loading" />
                  <div className="card-body">
                    <h5 className="card-title font-weight-">Card title</h5>
                    <p className="card-text">
                      Some quick example text to build on the card title and
                      make up the bulk of the card's content.
                    </p>
                    <NavLink to="https://getbootstrap.com/docs/5.0/getting-started/introduction/" className="btn btn-primary">
                      Go somewhere
                    </NavLink>
                  </div>
                </div>
              </div>
    </>
  );
};

export default Card;
